import React, { Component } from "react";
import styled from "styled-components";

class ChannelType extends Component {
  render() {
    return (
      <Channels className="container">
        <div className="col-12">
          <div className="row">
            <div className="grid-container">
              <div className="item">
                <span>Filmler</span>
              </div>
              <div className="item">
                <span>Diziler</span>
              </div>
              <div className="item">
                <span>Belgeseller</span>
              </div>
              <div className="item">
                <span>Canlı TV</span>
              </div>
              <div className="item">
                <span>Çocuk</span>
              </div>
            </div>
          </div>
        </div>
      </Channels>
    );
  }
}

const Channels = styled.div`
  .grid-container {
    display: grid;
    grid-template-columns: auto auto auto auto auto;
    grid-gap: 1rem;
    justify-content: center;
  }

  .item {
    padding: 10px;
    display: inline-block;
    border-radius: 30px;
    color: #44454f;
    font-weight: 500;
    background-color: rgba(255, 255, 255, 0.15);
    font-size: 18px;
    text-align: center;
  }
`;

export default ChannelType;
